/////////////////////------- Dados JANEIRO 2011 por Concelho -----////////////////////////

var minjaneiro11Conc = 9999;
var maxjaneiro11Conc = 0;

function CorPerAvaliacaoBancaria(d) {
    return d == null ? '#808080' :
        d >= 2164 ? '#8c0303' :
        d >= 1885  ? '#de1f35' :
        d >= 1421 ? '#ff5e6e' :
        d >= 956   ? '#f5b3be' :
        d >= 492    ? '#F2C572' :
                ''  ;
}
var legendaPerAvaliacaoBancária = function() {
    legendaA.textContent = '';
    legendaA.style.textAlign = 'left';
    legendaA.style.visibility = "visible";
    let symbolsContainer = document.createElement("div");
    symbolsContainer.className = 'legendaCoropleto'

    $(legendaA).append("<div class='subheader'>" + 'Unidade de medida: €/m²' +"</div>")

    symbolsContainer.innerHTML +=  '<i style="background:#8c0303"></i>' + '  > 2164' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#de1f35"></i>' + ' 1885 a 2164' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#ff5e6e"></i>' + ' 1421 a 1885' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#f5b3be"></i>' + ' 956 a 1421' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#F2C572"></i>' + ' 492 a 956' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#808080"></i>' + ' Sem informação disponível' + '<br>'



    $(legendaA).append(symbolsContainer); 
}

function Estilojaneiro11Conc(feature) {
    if((feature.properties.AB_T_JAN11 <= minjaneiro11Conc && feature.properties.AB_T_JAN11 > null) || feature.properties.AB_T_JAN11 === 0){
        minjaneiro11Conc = feature.properties.AB_T_JAN11
    }
    if(feature.properties.AB_T_JAN11 >= maxjaneiro11Conc ){
        maxjaneiro11Conc = feature.properties.AB_T_JAN11
    }
    return {
        weight: 1,
        opacity: 1,
        color: 'black',
        dashArray: '1',
        fillOpacity: 0.8,
        fillColor: CorPerAvaliacaoBancaria(feature.properties.AB_T_JAN11)
    };
}
function apagarjaneiro11Conc(e) {
    janeiro11Conc.resetStyle(e.target)
    e.target.closePopup();

} 

function onEachFeaturejaneiro11Conc(feature, layer) {
    if(feature.properties.AB_T_JAN11 === null){
        layer.bindPopup('Concelho: ' + '<b>' + feature.properties.Concelho + '</b>' + '<br>' + 'Valor mediano de avaliação bancária (€/ m²): ' + '<b>' + 'Sem dados disponíveis' + '</b>').openPopup()
    }
    else{
        layer.bindPopup( 'Concelho: ' + '<b> ' + feature.properties.Concelho + '</b>' + ' <br> '  + 'Valor mediano de avaliação bancária (€/ m²): ' + '<b>' + feature.properties.AB_T_JAN11.toFixed(0) + '€' + '</b>').openPopup()
    }
    layer.on({
        click: zoomToFeature,
        mouseover: hover,
        mouseout: apagarjaneiro11Conc,
    });
}
var janeiro11Conc= L.geoJSON(dadosRelativosConcelhos, {
    style:Estilojaneiro11Conc,
    onEachFeature: onEachFeaturejaneiro11Conc
});
let slidejaneiro11Conc = function(){
    var sliderjaneiro11Conc = document.querySelector('.sliderAtivo');


    if (ifSlide2isActive != 1){
        sliderAtivo.destroy();
    }

    noUiSlider.create(sliderjaneiro11Conc, {
        start: [minjaneiro11Conc, maxjaneiro11Conc],
        tooltips:true,
        connect: true,
        range: {
            'min': minjaneiro11Conc,
            'max': maxjaneiro11Conc
        },
        format: {
            to: (v) => parseFloat(v).toFixed(0),
            from: (v) => parseFloat(v).toFixed(0),
        }
        });
    inputNumberMin.setAttribute("value",minjaneiro11Conc);
    inputNumberMax.setAttribute("value",maxjaneiro11Conc);

    inputNumberMin.addEventListener('change', function(){
        sliderjaneiro11Conc.noUiSlider.set([this.value, null]);
    });
    inputNumberMax.addEventListener('change', function(){
        sliderjaneiro11Conc.noUiSlider.set([null, this.value]);
    });

    sliderjaneiro11Conc.noUiSlider.on('update',function(e){
        janeiro11Conc.eachLayer(function(layer){
            if (layer.feature.properties.AB_T_JAN11 == null ){
                return false;
            }
            if(layer.feature.properties.AB_T_JAN11.toFixed(0)>=parseFloat(e[0])&& layer.feature.properties.AB_T_JAN11.toFixed(0) <= parseFloat(e[1])){
                layer.addTo(map);
            }
            else{
                map.removeLayer(layer);
            }
        })})
        sliderjaneiro11Conc.noUiSlider.on('update', function( values, handle ) {
        if (handle==0){
            inputNumberMin.value = values[0];
        } else {
            inputNumberMax.value =  values[1];
        }
    })
    ifSlide2isActive = 1;
    sliderAtivo = sliderjaneiro11Conc.noUiSlider;
    $(slidersGeral).append(sliderjaneiro11Conc);
} 
janeiro11Conc.addTo(map);
$('#tituloMapa').html(' <strong>' + 'Valor mediano de avaliação bancária, em janeiro de 2011, por concelho.' + '</strong>');
legendaPerAvaliacaoBancária();
slidejaneiro11Conc();
