var minfevereiro15Conc = 9999;
var maxfevereiro15Conc = 0;

function Estilofevereiro15Conc(feature) {
    if((feature.properties.AB_T_FEV15 <= minfevereiro15Conc  && feature.properties.AB_T_FEV15 > null) || feature.properties.AB_T_FEV15 === 0){
        minfevereiro15Conc = feature.properties.AB_T_FEV15
    }
    if(feature.properties.AB_T_FEV15 >= maxfevereiro15Conc ){
        maxfevereiro15Conc = feature.properties.AB_T_FEV15
    }
    return {
        weight: 1,
        opacity: 1,
        color: 'black',
        dashArray: '1',
        fillOpacity: 0.8,
        fillColor: CorPerAvaliacaoBancaria(feature.properties.AB_T_FEV15)
    };
}
function apagarfevereiro15Conc(e) {
    fevereiro15Conc.resetStyle(e.target)
    e.target.closePopup();

} 

function onEachFeaturefevereiro15Conc(feature, layer) {
    if(feature.properties.AB_T_FEV15 === null){
        layer.bindPopup('Concelho: ' + '<b>' + feature.properties.Concelho + '</b>' + '<br>' + 'Valor mediano de avaliação bancária (€/ m²): ' + '<b>' + 'Sem dados disponíveis' + '</b>').openPopup()
    }
    else{
        layer.bindPopup( 'Concelho: ' + '<b> ' + feature.properties.Concelho + '</b>' + ' <br> '  + 'Valor mediano de avaliação bancária (€/ m²): ' + '<b>' + feature.properties.AB_T_FEV15.toFixed(0) + '€' + '</b>').openPopup()
    }
    layer.on({
        click: zoomToFeature,
        mouseover: hover,
        mouseout: apagarfevereiro15Conc,
    });
}
