var minVarDezNov14 = 99;
var maxVarDezNov14 = 0;

function CorVarDezNov14(d) {
    return d === null ? '#808080':
        d >= 6  ? '#de1f35' :
        d >= 2  ? '#ff5e6e' :
        d >= 0  ? '#f5b3be' :
        d >= -2.38  ? '#9eaad7' :
                ''  ;
}
var legendaVarDezNov14 = function() {
    legendaA.textContent = '';
    legendaA.style.textAlign = 'left';
    legendaA.style.visibility = "visible";
    let symbolsContainer = document.createElement("div");
    symbolsContainer.className = 'legendaCoropleto'

    $(legendaA).append("<div class='subheader'>" + 'Unidade de medida: €/ m²' + "</div>")
    $('#tituloMapa').html(' <strong>' + 'Variação do valor mediano de avaliação bancária, entre dezembro e novembro de 2014, por concelho.' + '</strong>')

    symbolsContainer.innerHTML +=  '<i style="background:#de1f35"></i>' + '  > 5' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#ff5e6e"></i>' + '  2 a 6' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#f5b3be"></i>' + '  0 a 2' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#9eaad7"></i>' + ' -2.37 a 0' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#808080"></i>' + ' Sem informação disponível' + '<br>'
    $(symbolsContainer).css("opacity","0.8")
    
    $(legendaA).append(symbolsContainer); 
}

function EstiloVarDezNov14(feature) {
    if((feature.properties.V_DezNov14 <= minVarDezNov14)){
        minVarDezNov14 = feature.properties.V_DezNov14
    }
    if(feature.properties.V_DezNov14 > maxVarDezNov14){
        maxVarDezNov14 = feature.properties.V_DezNov14 
    }
    return {
        weight: 1,
        opacity: 1,
        color: 'black',
        dashArray: '1',
        fillOpacity: 0.8,
        fillColor: CorVarDezNov14(feature.properties.V_DezNov14)};
    }


function apagarVarDezNov14(e) {
    VarDezNov14.resetStyle(e.target)
    e.target.closePopup();
} 

function onEachFeatureVarDezNov14(feature, layer) {
    if(feature.properties.V_DezNov14 === null){
        layer.bindPopup('Concelho: ' + '<b>' + feature.properties.Concelho + '</b>' + '<br>' + 'Variação: ' + '<b>' + 'Sem dados disponíveis' + '</b>').openPopup()
    }
    else{
        layer.bindPopup( 'Concelho: ' + '<b> ' + feature.properties.Concelho + '</b>' + ' <br> '  + 'Variação: ' + '<b>' + feature.properties.V_DezNov14.toFixed(2) + '%' + '</b>').openPopup()
    }
        layer.on({
        click: zoomToFeature,
        mouseover: hover,
        mouseout: apagarVarDezNov14,
    });
}
