        layer.bindPopup( 'Concelho: ' + '<b> ' + feature.properties.Concelho + '</b>' + ' <br> '  + 'Variação: ' + '<b>' + feature.properties.V_MaiAbr15.toFixed(2) + '%' + '</b>').openPopup()
