var minVarJanDez18 = 99;
var maxVarJanDez18 = 0;

function CorVarJanDez18(d) {
    return d === null ? '#808080':
        d >= 6  ? '#8c0303' :
        d >= 4  ? '#de1f35' :
        d >= 2  ? '#ff5e6e' :
        d >= 0  ? '#f5b3be' :
        d >= -2.4  ? '#9eaad7' :
                ''  ;
}
var legendaVarJanDez18 = function() {
    legendaA.textContent = '';
    legendaA.style.textAlign = 'left';
    legendaA.style.visibility = "visible";
    let symbolsContainer = document.createElement("div");
    symbolsContainer.className = 'legendaCoropleto'

    $(legendaA).append("<div class='subheader'>" + 'Unidade de medida: €/ m²' + "</div>")
    $('#tituloMapa').html(' <strong>' + 'Variação do valor mediano de avaliação bancária, entre janeiro de 2018 e dezembro de 2017, por concelho.' + '</strong>')

    symbolsContainer.innerHTML +=  '<i style="background:#8c0303"></i>' + '  > 6' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#de1f35"></i>' + '  4 a 6' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#ff5e6e"></i>' + '  2 a 4' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#f5b3be"></i>' + '  0 a 2' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#9eaad7"></i>' + ' -2.31 a 0' + '<br>'
    symbolsContainer.innerHTML +=  '<i style="background:#808080"></i>' + ' Sem informação disponível' + '<br>'
    $(symbolsContainer).css("opacity","0.8")
    
    $(legendaA).append(symbolsContainer); 
}
function EstiloVarJanDez18(feature) {
    if((feature.properties.V_JanDez18 <= minVarJanDez18)){
        minVarJanDez18 = feature.properties.V_JanDez18
    }
    if(feature.properties.V_JanDez18 > maxVarJanDez18){
        maxVarJanDez18 = feature.properties.V_JanDez18 
    }
    return {
        weight: 1,
        opacity: 1,
        color: 'black',
        dashArray: '1',
        fillOpacity: 0.8,
        fillColor: CorVarJanDez18(feature.properties.V_JanDez18)};
    }


function apagarVarJanDez18(e) {
    VarJanDez18.resetStyle(e.target)
    e.target.closePopup();
} 

function onEachFeatureVarJanDez18(feature, layer) {
    if(feature.properties.V_JanDez18 === null){
        layer.bindPopup('Concelho: ' + '<b>' + feature.properties.Concelho + '</b>' + '<br>' + 'Variação: ' + '<b>' + 'Sem dados disponíveis' + '</b>').openPopup()
    }
    else{
        layer.bindPopup( 'Concelho: ' + '<b> ' + feature.properties.Concelho + '</b>' + ' <br> '  + 'Variação: ' + '<b>' + feature.properties.V_JanDez18.toFixed(2) + '%' + '</b>').openPopup()
    }
        layer.on({
        click: zoomToFeature,
        mouseover: hover,
        mouseout: apagarVarJanDez18,
    });
}
