let slideVarFevJan20 = function(){
    var sliderVarFevJan20 = document.querySelector('.sliderAtivo');


    if (ifSlide2isActive != 271){
        sliderAtivo.destroy();
    }

    noUiSlider.create(sliderVarFevJan20, {
        start: [minVarFevJan20, maxVarFevJan20],
        tooltips:true,
        connect: true,
        range: {
            'min': minVarFevJan20,
            'max': maxVarFevJan20
        },
        });
    inputNumberMin.setAttribute("value",minVarFevJan20);
    inputNumberMax.setAttribute("value",maxVarFevJan20);

    inputNumberMin.addEventListener('change', function(){
        sliderVarFevJan20.noUiSlider.set([this.value, null]);
    });
    inputNumberMax.addEventListener('change', function(){
        sliderVarFevJan20.noUiSlider.set([null, this.value]);
    });

    sliderVarFevJan20.noUiSlider.on('update',function(e){
        VarFevJan20.eachLayer(function(layer){
            if (layer.feature.properties.V_FevJan20 == null ){
                return false;
            }
            if(layer.feature.properties.V_FevJan20.toFixed(2)>=parseFloat(e[0])&& layer.feature.properties.V_FevJan20.toFixed(2) <= parseFloat(e[1])){
                layer.addTo(map);
            }
            else{
                map.removeLayer(layer);
            }
        })})
        sliderVarFevJan20.noUiSlider.on('update', function( values, handle ) {
        if (handle==0){
            inputNumberMin.value = values[0];
        } else {
            inputNumberMax.value =  values[1];
        }
    })
    ifSlide2isActive = 271;
    sliderAtivo = sliderVarFevJan20.noUiSlider;
    $(slidersGeral).append(sliderVarFevJan20);
} 

