let reporAnos = function(){
    $('#meses').empty();
    if ($('#percentagem').hasClass('active4')){
        $('#meses').append("<option value='Janeiro'>janeiro</option>");
        $('#meses').append("<option value='Fevereiro'>fevereiro</option>");
        $('#meses').append("<option value='Marco'>março</option>");
        $('#meses').append("<option value='Abril'>abril</option>");
        $('#meses').append("<option value='Maio'>maio</option>");
        $('#meses').append("<option value='Junho'>junho</option>");
        $('#meses').append("<option value='Julho'>julho</option>");
        $('#meses').append("<option value='Agosto'>agosto</option>");
        $('#meses').append("<option value='Setembro'>setembro</option>");
        $('#meses').append("<option value='Outubro'>outubro</option>");
        $('#meses').append("<option value='Novembro'>novembro</option>");
        $('#meses').append("<option value='Dezembro'>dezembro</option>");
        primeirovalor('Janeiro','2011');
    }
    if ($('#taxaVariacao').hasClass('active4')){
        $('#meses').append("<option value='Janeiro'>janeiro - dezembro (ano anterior)</option>");
        $('#meses').append("<option value='Fevereiro'>fevereiro - janeiro</option>");
        $('#meses').append("<option value='Marco'>março - fevereiro</option>");
        $('#meses').append("<option value='Abril'>abril - março</option>");
        $('#meses').append("<option value='Maio'>maio - abril</option>");
        $('#meses').append("<option value='Junho'>junho - maio</option>");
        $('#meses').append("<option value='Julho'>julho - junho</option>");
        $('#meses').append("<option value='Agosto'>agosto - julho</option>");
        $('#meses').append("<option value='Setembro'>setembro - agosto</option>");
        $('#meses').append("<option value='Outubro'>outubro - setembro</option>");
        $('#meses').append("<option value='Novembro'>novembro - outubro</option>");
        $('#meses').append("<option value='Dezembro'>dezembro - novembro</option>")
        primeirovalor('Fevereiro',"2011");
    }
}

let VariacaoCondicionantes = function(){
    var ano = document.getElementById("mySelect").value
    var meses = document.getElementById("meses").value
    if ($('#percentagem').hasClass('active4')){
        if (ano == "2022"){
            removerOpcoes2022();
        }
        if (ano != "2022"){
            if ($("#meses option[value='Julho']").length == 0){
                $('#meses').append("<option value='Julho'>julho</option>");
                $('#meses').append("<option value='Agosto'>agosto</option>");
                $('#meses').append("<option value='Setembro'>setembro</option>");
                $('#meses').append("<option value='Outubro'>outubro</option>");
                $('#meses').append("<option value='Novembro'>novembro</option>");
                $('#meses').append("<option value='Dezembro'>dezembro</option>")
            }
        }
    }
    if ($('#taxaVariacao').hasClass('active4')){
        if (ano == "2011"){
            $("#meses option[value='Janeiro']").remove();
        }
        if (ano == "2022"){
            removerOpcoes2022();
        }
        if (ano != "2011"){
            if ($("#meses option[value='Janeiro']").length == 0){
                $("#meses option").eq(0).before($("<option></option>").val("Janeiro").text("janeiro - dezembro (ano anterior)"));
            }   
        }
        if (ano != "2022"){
            if ($("#meses option[value='Setembro']").length == 0){
                $('#meses').append("<option value='Julho'>julho - junho</option>");
                $('#meses').append("<option value='Agosto'>agosto - julho</option>");
                $('#meses').append("<option value='Setembro'>setembro - agosto</option>");
                $('#meses').append("<option value='Outubro'>outubro - setembro</option>");
                $('#meses').append("<option value='Novembro'>novembro - outubro</option>");
                $('#meses').append("<option value='Dezembro'>dezembro - novembro</option>") 
            }
        }
        if (meses == "Janeiro"){
            if ($("#mySelect option[value='2011']").length > 0){
                $("#mySelect option[value='2011']").remove();
            }
        }
        if (meses != "Janeiro"){
            if ($("#mySelect option[value='2011']").length == 0){
                $("#mySelect option").eq(0).before($("<option></option>").val("2011").text("2011"));

            }
        }
    }
    if (meses == "Julho" || meses == "Agosto" || meses == "Setembro" || meses == "Outubro" || meses == "Novembro" || meses == "Dezembro"){
        if ($("#mySelect option[value='2022']").length > 0){
            $("#mySelect option[value='2022']").remove();
        }
    }
    if (meses != "Julho" && meses != "Agosto" && meses != "Setembro" && meses != "Outubro" && meses != "Novembro" && meses != "Dezembro"){
        if ($("#mySelect option[value='2022']").length == 0){
            $('#mySelect').append("<option value='2022'>2022</option>");
        }
    }

}
